import { Outlet, Link } from "react-router-dom";

function Story1() {
    return(
        <div>
            <img src='https://storage.googleapis.com/senior-proj-images/images/junghan-1.jpeg' className='image-left'/>
            <p className = 'image-text-right'>The first time we talked was towards high school graduation. The date was March 29th and I gave her a letter. Letters became very important during our courtship because once we graduated from high school, we were in different cities and eventually different states in a new country.
</p>
            <img src='https://storage.googleapis.com/senior-proj-images/images/junghan-2.JPG' className='image-right'/>
            <p className = 'image-text-left'>We have a whole trunk of letters we wrote to each other from when we dated. I think I have personally written around 400.</p>
            <img src='https://storage.googleapis.com/senior-proj-images/images/junghan-3.JPG' className='image-left'/>
            <p className = 'col-text'>I wrote about my reflections and thoughts in most of these letters. They were more like diary entries than letters to your loved one. It's funny to see how formal I used to be. By the time I wrote this letter we had already been dating, but I still referred to her as "classmate." Her birthday was coming up and I hadn't found a proper card to send her, even though I had visited 3 different stationery stores. So instead I asked her if she would be interested in getting a cake and splitting it together. </p>
        </div>
    );
}

export default Story1;
